import React from 'react'
import {TileWrapper, TileHeadline, TileIcon} from "./CourseTileElements"


const CourseTile = ({
    headline
}) => {
    return (
        <>
        <TileWrapper>
            <TileIconWrap>
                <TileIcon />

            </TileIconWrap>
          <TileHeadline>
              {headline}
            </TileHeadline> 
        </TileWrapper>
        </>
    )
}

export default CourseTile
